import Labs from "./labs";
import HelloWorld from "./labs/a3/hello-world";
import Tuiter from "./tuiter";
import JavaScript from "./labs/a3/java-script";

function App() {
  return (
    <div className="container">
      <HelloWorld/>
      <Labs/>
      <Tuiter/>
      <JavaScript/>
    </div>
  );
}
export default App;
